    tileUtil.setWalls(sprites.dungeon.greenOuterEast1, true)
    tileUtil.setWalls(sprites.dungeon.greenOuterNorth0, true)
    tileUtil.setWalls(sprites.dungeon.greenOuterSouth0, true)
